  true,\n\t\"url\": null,\n\t\"notes\": \"The Investing in Innovation (i3) Fund website
  depicts and allows downloading of general information on the i3 applicants received,
  grantees awarded and project locations. The Investing in Innovation Fund, established
  under section 14007 of the American Recovery and Reinvestment Act of 2009 (ARRA),
  provides funding to support (1) local educational agencies (LEAs), and (2) nonprofit
  organizations in partnership with (a) one or more LEAs or (b) a consortium of schools.
  The purpose of the i3 program is to provide competitive grants to applicants with
  a record of improving student achievement and attainment in order to expand the
  implementation of, and investment in, innovative practices that are demonstrated
  to have an impact on improving student achievement or student growth, closing achievement
  gaps, decreasing dropout rates, increasing high school graduation rates, or increasing
  college enrollment and completion rates. These grants will (1) allow eligible entities
  to expand and develop innovative practices that can serve as models of best practices,
  (2) allow eligible entities to work in partnership with the private sector and the
  philanthropic community, and (3) identify and document best practices that can be
  shared and taken to scale based on demonstrated success.\",\n\t\"license_title\":
